	Author(s) : David Charles - AddMustard
*/
import { Link } from "react-router-dom";
import axios from "axios";
import './MaterialCreate.scss';
import { useEffect, useRef, useState } from "react";

//exports
export default function MaterialCreate(props) {
	//properties

	//states

	//refs

	//functions

	//variables

	//Effects

	return (
		<div className="MaterialCreate"> 
            <div className="inner">
                <h4>Make New Contribution</h4>

                <div className="MaterialCreation">
                    <div className="inner">
                        <div className='infoContainer'>
                            <div className='inner'>
                                <h4>New recipe</h4>

                                <p>To get started, give your recipe a name and choose how you'd to input data.</p>	
                            </div>	
                        </div> 

                        <form>
                            <div className='materialName'>
                                <div className="inner">
                                    <h4 className="required">Recipe Title</h4>

                                </div>
                            </div>	

                            <div className='materialRef'>
                                <div className="inner">
                                    <h4>Recipe Code</h4>

                                </div>
                            </div>

                            <div className='materialCreationOptions'>
                                <div className="inner">
                                    <h4>Create new recipe from:</h4>

                                    <div>
                                        <p onClick={ handleAddMaterial }>Submit</p>
                                    </div>
                                </div>
                            </div>		
                        </form>
                    </div>
                </div>
            </div>		
		</div>
	);
}
